import React from "react";
import { connect } from "react-redux";
import { typeOfHouse } from "../actions";
import "./Buttons.css";

const ButtonToSelect = () => {
  return (
    <select className="btn-sel" onChange={this.props.typeOfHouse()}>
      <option value="small">Small House</option>
      <option value="middle" selected>
        Middle House
      </option>
      <option value="big">Big House</option>
    </select>
  );
};
const mapStateToProps = state => {
  console.log(state);
};

const mapDispatchToProps = {
  typeOfHouse
};

export default connect(
  null,
  mapDispatchToProps
)(ButtonToSelect);
